import logo from './logo.svg';
import './App.css';
import { useState } from "react";

function App() {
  const [cart, setCart] = useState({});
  const [length, setLength] = useState(25);
  const [filterLength, setFilterLength] = useState(false);
  const [filterArtist, setFilterArtist] = useState([]); //change based on artists
  const [sortBy, setSortBy] = useState(false);
  const [playlistMinutes, setPlaylistMinutes] = useState(0);
  const [playlistSeconds, setPlaylistSeconds] = useState(0);

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
